user.prototype.test =  function(req, res) { 
	var fs = require("fs");
	var in_image = "data:image/jpg;base64,";
	var imageArray = in_image.split(',');
	var image = imageArray[1];
	var extention = imageArray[0].substring(imageArray[0].lastIndexOf("/")+1,imageArray[0].lastIndexOf(";"));
	var bitmap = new Buffer(image, 'base64');
	var image_url = './public/images/users/';
	image_url = image_url  + '/profile-picture-' + '1' +'.' + extention;
	fs.writeFileSync(image_url, bitmap);
	res.send({success: "true"});
}

user.prototype.get =  function(req, res) { 
	tomodel.user_id = req.session.user_id;
	var result = res.locals;
	user_model.select_user(tomodel, function(err,rows){
		console.log(err);
		if(rows.length > 0) {
			result['code'] = '200';
			try {
				var age = calcAge(rows[0].birth_date);
				var birthday = formatDate(rows[0].birth_date);
				rows[0]['age'] = age;
				rows[0]['birthday'] = birthday;	
			}
			catch(err) {
				rows[0]['age'] = "";
				rows[0]['birthday'] = "";
			}
			result['user_info'] = rows[0];
			get_current_user_activity(req, res, result);
		}
		else {
			result['code'] = '400';
			res.send(result);
		}
		
	});
}

