user.prototype.get_profile =  function(req, res) {
	tomodel.user_id = req.body.user_id;
	if(Number.isInteger(parseInt(tomodel.user_id))) {
		user_model.select_user_profile(tomodel, function(err,rows){
			if(rows.length > 0) {
				var age = calcAge(rows[0].birth_date);
				var birthday = formatDate(rows[0].birth_date);
				rows[0]['age'] = age;
				rows[0]['birthday'] = birthday;
				get_current_user_activity(req, res, rows[0]);
			}
			else {
				res.send({code:'403', message:'not a valid id'});
			}
			
		});
	}
	else {
		res.send({code:'403', message:'not a valid id'});
	}
}

function get_current_user_activity(req, res, result) {
	user_activity_model.select_user_activities_details(tomodel, function(err,rows) {
		result['activities'] = rows;
		// console.log(result);
		res.send(result);
	});
}

function calcAge(dateString) {
  var birthday = +new Date(dateString);
  return ~~((Date.now() - birthday) / (31557600000));
}

function formatDate(date) {
  var monthNames = [
    "Jan", "Feb", "Mar",
    "Apr", "May", "Jun", "Jul",
    "Aug", "Sep", "Oct",
    "Nov", "Dec"
  ];
  
  var day = date.getDate();
  var monthIndex = date.getMonth();
  var year = date.getFullYear();

  return monthNames[monthIndex] + ' '+ day + ',' + year;
}

user.prototype.update =  function(req, res) {
	var user_info = req.body.user_info;
	var validation_array = update_user_validations(user_info);
    if(Object.keys(validation_array).length > 0) {
		var result = controller.mergeArrays(validation_array, {code: 404, message:'Bad Request'});
		res.send(result);
	}
	else{
		tomodel.user_id = req.session.user_id;
		tomodel.first_name = user_info.first_name;
		tomodel.last_name = user_info.last_name;
		tomodel.country_id = user_info.country_id;
		tomodel.birth_date = user_info.birth_date;
		tomodel.about = user_info.about;
		console.log(user_info.image64);
		if(user_info.image64) {
			var imageArray = user_info.image64.split(',');
			var image = imageArray[1];
			var extention = imageArray[0].substring(imageArray[0].lastIndexOf("/")+1,imageArray[0].lastIndexOf(";"));
			var bitmap = new Buffer(image, 'base64');
			var image_url = './public/images/users/' + req.session.user_id;
			if (!controller.fs.existsSync(image_url)){
			    controller.fs.mkdirSync(image_url);
			}
			image_url = image_url  + '/profile-picture-' + controller.randomString(5) +'-' + req.session.user_id +'.' + extention;  
		    controller.fs.writeFileSync(image_url, bitmap);
		    var base = req.protocol + '://' + req.get('host');
		    tomodel.image_url = image_url.replace('./public',base);
			user_model.update_user_image_url(tomodel, function(err,rows){});
		}
		if(user_info.cover_image64) {
			var imageArray = user_info.cover_image64.split(',');
			var image = imageArray[1];
			var extention = imageArray[0].substring(imageArray[0].lastIndexOf("/")+1,imageArray[0].lastIndexOf(";"));
			var bitmap = new Buffer(image, 'base64');
			var cover_image_url = './public/images/users/' + req.session.user_id;
			if (!controller.fs.existsSync(cover_image_url)){
			    controller.fs.mkdirSync(cover_image_url);
			}
			cover_image_url = cover_image_url  + '/cover-photo-' + controller.randomString(5) +'-' + req.session.user_id +'.' + extention;	    
		    controller.fs.writeFileSync(cover_image_url, bitmap);
		    var base = req.protocol + '://' + req.get('host');
		    tomodel.cover_image_url = cover_image_url.replace('./public',base);
			user_model.update_user_cover_image_url(tomodel, function(err,rows){});
		}
		user_model.update_user(tomodel, function(err,rows){
			var result = res.locals;
			result['code'] = '200';
			res.send(result);
		});
	}
}

function update_user_validations(data) {
	var validation_array = {};
	
	var first_name = controller.validate({first_name: data.first_name},['required','length:0-30']);
	if(first_name){
		validation_array = controller.mergeArrays(validation_array, first_name);
	}
	
	var last_name = controller.validate({last_name: data.last_name},['required','length:0-30']);
	if(last_name){
		validation_array = controller.mergeArrays(validation_array, last_name);
	}	
	
	var country_id = controller.validate({country_id: data.country_id},['required','integer']);
	if(country_id){
		validation_array = controller.mergeArrays(validation_array, country_id);
	}	
	
	var birth_date = controller.validate({birth_date: data.birth_date},['required']);
	if(birth_date){
		validation_array = controller.mergeArrays(validation_array, birth_date);
	}
	else if(!controller.isValidDate(data.birth_date)) {
		validation_array = controller.mergeArrays(validation_array, {birth_date_error: 'Birth Date is not valid'});	
	}
	

	if(data.about) {
		var about = controller.validate({about: data.about},['length:0-1000']);
		if(about){
			validation_array = controller.mergeArrays(validation_array, about);
		}
	}

	if(data.image_url) {
		var image_url = controller.validate({image_url: data.image_url},['match_regex:^([0-9a-zA-Z+/]{4})*(([0-9a-zA-Z+/]{2}==)|([0-9a-zA-Z+/]{3}=))?$||This is not a valid image']);
		if(image_url){
			validation_array = controller.mergeArrays(validation_array, image_url);
		}
	}

	if(data.cover_image_url) {
		var cover_image_url = controller.validate({cover_image_url: data.cover_image_url},['match_regex:^([0-9a-zA-Z+/]{4})*(([0-9a-zA-Z+/]{2}==)|([0-9a-zA-Z+/]{3}=))?$||This is not a valid image']);
		if(cover_image_url){
			validation_array = controller.mergeArrays(validation_array, cover_image_url);
		}
	}
	return validation_array;
}

function location_validations(data) {
	var validation_array = {};
	
	var lng = controller.validate({lng: data.lng.toString()},['required', 'match_regex:^(\\+|-)?(?:180(?:(?:\\.0{1,})?)|(?:[0-9]|[1-9][0-9]|1[0-7][0-9])(?:(?:\\.[0-9]{1,})?))$||This is not a valid longitude']);
	if(lng){
		validation_array = controller.mergeArrays(validation_array, lng);
	}
	var lat = controller.validate({lat: data.lat.toString()},['required', 'match_regex:^(\\+|-)?(?:90(?:(?:\\.0{1,})?)|(?:[0-9]|[1-8][0-9])(?:(?:\\.[0-9]{1,})?))$||This not a valid latitude']);
	if(lat){
		validation_array = controller.mergeArrays(validation_array, lat);
	}	
	
	return validation_array;
}

